var tipuesearch = {"pages": [{'title': 'About', 'text': 'https://github.com/s40523241/cad2019 \n \n', 'tags': '', 'url': 'About.html'}, {'title': 'Tools', 'text': '\n', 'tags': '', 'url': 'Tools.html'}, {'title': 'SSH Key', 'text': '\n', 'tags': '', 'url': 'SSH Key.html'}, {'title': 'GitExtensions', 'text': '', 'tags': '', 'url': 'GitExtensions.html'}, {'title': 'webots', 'text': '\n', 'tags': '', 'url': 'webots.html'}, {'title': 'NX12', 'text': '\n', 'tags': '', 'url': 'NX12.html'}, {'title': 'solvespace編譯', 'text': '\n 將solvespace編譯完後 可利用solvespace畫圖 \n \n', 'tags': '', 'url': 'solvespace編譯.html'}, {'title': '編譯步驟', 'text': '\n 將 Y:\\portablegit\\bin\\sh.exe 改名為 sh_rename_for_solvespace.exe (透過 MSYS2 執行 shell 指令, 而非 portablegit 中的 sh.exe) \n git version 查驗 git 版本 \n git 2.13 版本以上, 可以使用下列 git clone \xa0 --recurse-submodules 取得所有子模組資料 \n git clone --recurse-submodules https://github.com/solvespace/solvespace.git solvespace \n 上述指令同: \n git clone\xa0 https://github.com/solvespace/solvespace.git \xa0 \n cd solvespace \n git submodule init \n git submodule update \n edit Y:\\tmp\\solvespace\\extlib\\angle\\CMakeLists.txt comment out line 713 and 714 \n #list(APPEND ANGLE_DEFINITIONS #"-DANGLE_PRELOADED_D3DCOMPILER_MODULE_NAMES={ \\"d3dcompiler_47.dll\\", \\"d3dcompiler_46.dll\\", \\"d3dcompiler_43.dll\\" }") endif() \n 接著需要手動進行 libpng.dll.a 的編譯, 並改名為 libpng_static.a, 並放到編譯系統的 lib 目錄中 (即隨身系統的 msys64\\mingw64\\lib 目錄): \n cd solvespace \n cd extlib \n cd libpng \n mkdir build \n cd build \n cmake .. -G "MinGW Makefiles" -DCMAKE_BUILD_TYPE=Release mingw32-make \n (mingw32-make -Wl,-static) \n rename libpng.dll.a to libpng_static.a and copy to Y:\\msys64\\mingw64\\lib \n 接著回到 solvespace 原始碼目錄, 建立 build 目錄後進入 build 目錄, 執行: \n cmake .. -G "MinGW Makefiles" -DCMAKE_BUILD_TYPE=Release mingw32-make \n 編譯完成後, 可以在 build\\bin 目錄中建立 solvespace.exe, 配合相關 dll 檔案後, 即可執行. \n', 'tags': '', 'url': '編譯步驟.html'}, {'title': 'V-rep模擬', 'text': '\n 兩輪車模擬影片 \n', 'tags': '', 'url': 'V-rep模擬.html'}]};